import { AccountCircle } from '@material-ui/icons';
import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
display:flex;padding:5px 2px 5px 2px;
border:solid 0.2px blue;
margin-bottom:5px;
`;
const AssignPicture = styled.div`width:30px;height:30px;border-radius:50%;
color:white;background-color:#${props=>props.color};
display:flex;justify-content:center;align-items:center;marign-right:200px;`;

const Title = styled.h1``;

const Status = styled.h1``;

const TodoItem = ({item}) => {
    return (
        <Container>
               <AssignPicture color="e3506b">
               <AccountCircle/>
               <Title>{item.title}</Title>
               <Status></Status>
            </AssignPicture>
               
        </Container>
    )
}

export default TodoItem
